import React from "react";
import { Bag } from "../../assets/icons/icons";
import Styles from "./Header.module.scss";


export const Header = () => {
  return (
    <div>
      <div>
        <img src="" alt="OfficeSupplies logo" />
      </div>
      <div className={Styles.search}>
        <input />
        <button />
      </div>
      <div className={Styles.summary}>
        <Bag />
        <button />
      </div>
    </div>
  );
};
